I’ve been making my list and checking it twice! I love shopping locally and especially love supporting Vermont Made and Women Owned businesses. I made a quick list of some of my favorites and stopped at a dozen before it got too long but I could go on and on! So many of these wonderful women have studios in my building (some even on my floor!) and many are also available @thirtyoddvt downstairs, on the South End corner of @thesodaplant. They’re all very active with their businesses and well stocked for the holidays! They all create amazing products that I love to give and that I LOVE to receive! I’ve listed them alphabetically on my new blog post at the top of my website, just click my profile link to read it! 
